the+front+of+this+agreement%2C+Purchaser+may%2C+if+dissatisfied+therewith%2C+cancel+this+agreement%2C+provided+however%2C+that+such+right+to+cancel+must+be+exercised+prior+to+delivery+of+the+motor+vehicle+purchased+hereunder+and+prior+to+the+surrender+to+Seller+of+the+used+motor+vehicle+being+traded+in.++++%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EIf+this+agreement+is+not+consummated+for+any+reason+and+Purchaser%27s+trade-in+vehicle+is+sold+by+the+Seller%2C+Seller%27s+maximum+liability+to+Purchaser+shall+be+for+the+proceeds+of+said+sale+less+reasonable+expenses+incurred+by+the+Seller+in+storing%2C+insuring%2C+repairing+and+selling+said+trade-in+vehicle.%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EUnless+this+agreement+shall+have+been+canceled+by+Purchaser+in+accordance+with+the+provisions+of+paragraphs+9+or+12+herein%2C+and+to+the+extent+not+prohibited+by+law%2C+And%2C+in+the+event+a+used+motor+vehicle+has+been+traded+in+as+part+of+the+consideration+for+the+motor+vehicle+purchased+hereunder%2C+Seller+should+be+entitled+to+sell+such+used+motor+vehicle+and+reimburse+himself+out+of+the+proceeds+of+such+sale+for+the+expenses+incurred+thereby+and+for+such+other+expenses+and+losses+as+Seller+may+incur+or+suffer+as+a+result+of+such+failure+or+refusal+by+Purchaser.++++%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EIf+cash+delivered+price+is+increased+by+Seller%2C+Purchaser+may%2C+if+dissatisfied+therewith%2C+cancel+this+agreement.+If+a+used+motor+vehicle+has+been+traded+in+as+part+of+the+consideration+for+such+motor+vehicle%2C+such+trade-in+vehicle+shall+be+returned+to+Purchaser+upon+payment+of+a+reasonable+charge+for+storage+and+repairs+%28if+any%29+or%2C+if+such+trade-in+vehicle+has+been+previously+sold+by+Seller%2C+the+amount+received+therefor%2C+less+reasonable+expenses+incurred+by+Seller+in+storing%2C+insuring%2C+repairing+and+selling+said+trade-in+vehicle.%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3ESeller+shall+not+be+liable+for+any+delay+or+failure+to+deliver+the+motor+vehicle+subject+to+