ITING+TO+PURCHASER%2C+THE+VEHICLE+IS+SOLD+%27AS+IS%27+WITH+NO+WARRANTY.+THE+ONLY+WARRANTIES+APPLYING+TO+THIS+VEHICLE+ARE+THOSE+SUPPLIED+BY+THE+MANUFACTURER%2C+IF+ANY.+THE+SELLER+HEREBY+EXPRESSLY+DISCLAIMS+ALL+WARRANTIES%2C+EITHER+EXPRESS+OR+IMPLIED%2C+INCLUDING+ANY+IMPLIED+WARRANTIES+OF+MERCHANTABILITY+OR+FITNESS+FOR+A+PARTICULAR+PURPOSE.+PURCHASER+SHALL+NOT+BE+ENTITLED+TO+RECOVER+FROM+THE+SELLER+ANY+CONSEQUENTIAL+DAMAGES%2C+DAMAGES+TO+PROPERTY%2C+FOR+LOSS+OF+USE%2C+LOSS+OF+TIME%2C+LOSS+OF+PROFITS+OR+INCOME+OR+ANY+OTHER+INCIDENTAL+DAMAGES+WHATSOEVER.%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EPurchaser+certifies+that+he+or+she+has+read%2C+understood+and+agreed+to+all+the+terms+and+conditions+on+page+one+and+page+two+of+this+agreement.+THIS+AGREEMENT+SHALL+NOT+BECOME+BINDING+UNTIL+ACCEPTED+BY+AN+AUTHORIZED+REPRESENTATIVE+OF+THE+SELLER.%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EIf+Purchaser+is+buying+the+motor+vehicle+for+cash+%28this+includes+a+Purchaser+arranging+his+own+financing%29%2C+Purchaser+agrees+to+pay+the+balance+owed+under+this+agreement+on+or+before+the+delivery+date.+If+Purchaser+is+buying+the+motor+vehicle+in+a+credit+sale+transaction+with+Seller%2C+which+is+evidenced+by+an+executed+installment+sale+contract%2C+this+agreement+will+not+remain+binding+if+a+third+party+finance+source+does+not+agree+to+purchase+the+installment+sale+contract+based+on+this+agreement.%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3E+If+for+any+reason%2C+Seller+and+Purchaser+do+not+complete+the+motor+vehicle+sale+and+purchase%2C+or+a+third+party+finance+source+does+not+agree+to+purchase+the+installment+sale+contract%2C+Purchaser+agrees+to+return+the+motor+vehicle+to+Seller+within+24+hours+of+notice+or+demand+by+Seller.+Purchaser+agrees+to+pay+Seller+on+demand+all+reasonable+charges+and+expenses+for+any+damage+to+the+motor+vehicle.+If+Purchaser+fails+to+return+the+motor+vehicle+within+24+hours+of+notice+or+demand%2C+Purchaser+agrees+that+Seller+may%2C+in+its+sole+discretion%2C+cancel+the+sale+and+retake+immediate+possession+of+the+motor+vehicle.+In+such+event%2C+Purchaser+agrees+to+pay+Seller+all+reasonable+expenses+incurred+in+connection+with+retaking+the+motor+vehicle%2C+including+attorney%27s+fees+and+other+expenses+to+the+extent+permitted+by+applicable+law.++++%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EPurchaser+acknowledges+that+the+vehicle+purchased+hereunder+has+a+%27Buyer%27s+Guide%27+label+affixed+thereto.++++%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EPurchaser+agrees+to+deliver+to+Seller+the+certificate+of+title+to+any+used+motor+vehicle+traded+in+as+part+of+the+consideration+for+the+motor+vehicle+purchased+or+to+be+purchased+hereunder%2C+at+the+time+of+delivery+of+such+motor+vehicle+to+Seller.+Purchaser+warrants+that+he+has+good%3Cbr%3E%0A+and+marketable+title+to+the+used+motor+vehicle+traded+in%2C+and+further%2C+that+such+used+motor+vehicle+is+free+and+clear+of+all+liens+and+encumbrances+except+as+otherwise+noted+herein.+In+the+event+that+Purchaser%27s+trade-in+vehicle+is+subject+to+an+outstanding+lien%2C+Purchaser+represents+and+warrants+that+the+payoff+quoted+herein+is+accurate.+If+there+is+any+difference+between+the+actual+lien+payoff+on+the+vehicle+traded+in+and+the+lien+balance+as+stated+herein%2C+Purchaser+shall+be+solely+responsible+for+any+additional+amounts+owing+to+the+lienholder.+Purchaser+agrees+to+indemnify+and+hold+Seller+harmless+from+any+excess+amounts+paid+to+the+lienholder+to+secure+title+to+the+trade-in+vehicle%2C+over+and+above+the+balance+as+stated+herein%2C+including%2C+without+limitation%2C+all+reasonable+attorney+fees+and+costs+incurred+by+Seller+in+enforcing+its+rights+hereunder.++++%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EIf+the+used+motor+vehicle+which+has+been+traded+in+as+a+part+of+the+consideration+for+the+motor+vehicle+purchased+hereunder+is+not+to+be+delivered+to+Seller+immediately%2C+Seller+shall+be+entitled+to+re-appraise+the+trade-in+vehicle+at+the+time+of+delivery+in+order+to+determine+the+trade-in+allowance.+If+such+re-appraised+value+is+lower+than+the+original+allowance+shown+therefor+on+the+front+of+this+agreement%2C+Purchaser+may%2C+if+dissatisfied+therewith%2C+cancel+this+agreement%2C+provided+however%2C+that+such+right+to+cancel+must+be+exercised+prior+to+delivery+of+the+motor+vehicle+purchased+hereunder+and+prior+to+the+surrender+to+Seller+of+the+used+motor+vehicle+being+traded+in.++++%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EIf+this+agreement+is+not+consummated+for+any+reason+and+Purchaser%27s+trade-in+vehicle+is+sold+by+the+Seller%2C+Seller%27s+maximum+liability+to+Purchaser+shall+be+for+the+proceeds+of+said+sale+less+reasonable+expenses+incurred+by+the+Seller+in+storing%2C+insuring%2C+repairing+and+selling+said+trade-in+vehicle.%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EUnless+this+agreement+shall+have+been+canceled+by+Purchaser+in+accordance+with+the+provisions+of+paragraphs+9+or+12+herein%2C+and+to+the+extent+not+prohibited+by+law%2C+And%2C+in+the+event+a+used+motor+vehicle+has+been+traded+in+as+part+of+the+consideration+for+the+motor+vehicle+purchased+hereunder%2C+Seller+should+be+entitled+to+sell+such+used+motor+vehicle+and+reimburse+himself+out+of+the+proceeds+of+such+sale+for+the+expenses+incurred+thereby+and+for+such+other+expenses+and+losses+as+Seller+may+incur+or+suffer+as+a+result+of+such+failure+or+refusal+by+Purchaser.++++%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3EIf+cash+delivered+price+is+increased+by+Seller%2C+Purchaser+may%2C+if+dissatisfied+therewith%2C+cancel+this+agreement.+If+a+used+motor+vehicle+has+been+traded+in+as+part+of+the+consideration+for+such+motor+vehicle%2C+such+trade-in+vehicle+shall+be+returned+to+Purchaser+upon+payment+of+a+reasonable+charge+for+storage+and+repairs+%28if+any%29+or%2C+if+such+trade-in+vehicle+has+been+previously+sold+by+Seller%2C+the+amount+received+therefor%2C+less+reasonable+expenses+incurred+by+Seller+in+storing%2C+insuring%2C+repairing+and+selling+said+trade-in+vehicle.%3C%2Fli%3E%0A%09%09%09%09%09++%3Cli%3ESeller+shall+not+be+l